import React, { Component } from 'react'
import { Modal} from 'semantic-ui-react';
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";


export default class EditAssign extends Component {
    render() {
        return (
            <Modal size="large" trigger={<i id="assign-icon" className="edit blue icon"></i>}>
                <Modal.Header>Create New Assignment</Modal.Header>
                    <Modal.Content >

                       <form className="ui form" onSubmit={this.submitAssign}>
                            <div className="field">
                                <label>Title</label>
                                <input type="text"  placeholder="title"
                                        name= "title"
                                        // value = {this.state.title}
                                        // onChange={this.handleChange}
                          />
                            </div>
                            <div className="field">
                                <label>Due Date:</label>
                                <DatePicker 
                                selected={this.state.startDate}
                                // onChange={(date ) => this.handleDate(date)}

                                minDate={new Date()}    
                                />
                            </div>

                            <div className="field">
                                <label>Assignemt</label>
                                <textarea type="text"  placeholder="content"
                                // onChange= {this.handleChange}
                                // value = {this.state.assign}
                                name = "assign"
                                ></textarea>
                            </div>

                            <button className="ui button" type="submit">Submit</button>
                        </form>
                   </Modal.Content>
            </Modal>
        )
    }
}
